import React from 'react';
import './style.css';
import { Link } from 'react-router-dom';
import imgBrasilia from '../../Imagens/imgBrasilia.jpg'
import imgSaoPaulo from '../../Imagens/imgSaoPaulo.jpg'
import imgRioDeJaneiro from '../../Imagens/imgRioDeJaneiro.jpg'
import imgFortaleza from '../../Imagens/imgFortaleza.jpg'
import imgMaceio from '../../Imagens/imgMaceio.jpg'
import imgPernambuco from '../../Imagens/imgPernambuco.jpg'


const Promocoes = () => {
    return (
        <article className='container page_body'>
            
                <h1>Promoções</h1>
                
                <p>
                <Link className='btn btn-light' to="/cadastrar">Cadastrar Cupom &raquo;</Link>
                </p>

                <img src={imgRioDeJaneiro}  className="row col-md-6 imgRJ"/>
                               
                <img src={imgBrasilia} alt="Imagem" className="row col-md-6 imgDF" />
                
                

                <img src={imgFortaleza} alt="Imagem" className="col-md-6 imgCE" />
                <img src={imgMaceio} alt="Imagem" className="col-md-6 imgAL" />
                <img src={imgPernambuco} alt="Imagem" className="col-md-6 imgPE" />
                <img src={imgSaoPaulo} alt="Imagem" className="col-md-6 imgSP" />
               
                
           

        </article>
    );
}

export default Promocoes;
